import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { RouterModule, Routes } from '@angular/router';

import { SharedModule } from 'src/app/shared/shared.module';
import { SettingsPage } from '../user/pages/settings/settings.page';
import { UpdateProfileComponent } from '../user/components/update-profile/update-profile.component';
import { UpdatePasswordComponent } from '../user/components/update-password/update-password.component';

const routes: Routes = [
    { path: '', component: SettingsPage },
];

@NgModule({
    declarations: [
        SettingsPage,
        UpdateProfileComponent,
        UpdatePasswordComponent,
    ],
    imports: [
        CommonModule,
        FormsModule,
        ReactiveFormsModule,
        RouterModule.forChild(routes),
        SharedModule,
    ]
})
export class UserModule { }
